import NavBar from './components/navbar';
import Counters from './components/counters';
import './App.css';

class App extends Component {

  state = { 
    counters: [
        { id: 1, value: 1000 },
        { id: 2, value: 0 },
        { id: 3, value: 0 },
        { id: 4, value: 0 }
    ]
  }

  render() { 
    return (
    <React.Fragment>
    <NavBar />
    <main className = "container">
      <Counters />
    </main>
    </React.Fragment>
    );
  }
}

export default App;
